// import { useState, useEffect } from 'react';
import React from 'react';
import { Container, Row, Col } from 'styled-bootstrap-grid';
import styled from 'styled-components';

import Banner from '../../containers/Banner';
import TripSection from '../../containers/TripSection';
import ProvinceSection from '../../containers/ProvinceSection';

const CTAFooter = styled.section`
  padding: 15px;
  margin-top: 20px;
  background-image: url('https://via.placeholder.com/1200x450');
  min-height: 450;
  position: relative;
  border-radius: 5px;
`;

const Homepage = () => (
  <div>
    <Banner />
    <ProvinceSection />
    <TripSection />

    <CTAFooter>
      <Container>
        <Row>
          <Col col={7}>
            <h2>สร้างเรื่องราวการท่องเที่ยวแบบใหม่ อีกทั้งยังทำเงินให้คุณได้ด้วย</h2>

          </Col>
        </Row>
      </Container>
    </CTAFooter>
  </div>
);

export default Homepage;
